import 'dart:convert';

class Geolocation {
  String? lat;
  String? long;

  Geolocation({this.lat, this.long});

  @override
  String toString() => 'Geolocation(lat: $lat, long: $long)';

  factory Geolocation.(
      Map<String, dynamic> data) {
    return Geolocation(
      lat: data['lat'] as String?,
      long: data['long'] as String?,
    );
  }

  Map<String, dynamic>
      () {
    return {
      'lat': lat,
      'long': long,
    };
  }

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [Geolocation].
  factory Geolocation.fromJson(String data) {
    return Geolocation
        .(
            json.decode(data) as Map<String, dynamic>);
  }

  /// `dart:convert`
  ///
  /// Converts [Geolocation] to a JSON string.
  String toJson() => json.encode(
      ());

  Geolocation copyWith({
    String? lat,
    String? long,
  }) {
    return Geolocation(
      lat: lat ?? this.lat,
      long: long ?? this.long,
    );
  }
}
